import './check-out.styles.scss';

const CheckOut = () => {
    return (
        <div> 
            <table>
                <tr>
                    <td>Product</td>
                    <td>Description</td>
                    <td>Quantity</td>
                    <td>Price</td>
                    <td>Remove</td>
                </tr>
            </table>
        </div>
    );
};

export default CheckOut;
